    "2013-03-15T22:57:35.440992",nt"name": "environmental-geology-of-the-brattleboro-windsor-region-vermont",nt"isopen":
    false,nt"url": null,nt"notes": "This resource is available as a downloadable
    file, ESRI Service, and as a Web Feature service.  Resource includes five plates
    with downloadable images: Plate I: Surficial Material, Plate II: Bedrock Geology,
    Plate III: Ground Water Potential, Plate IV: Solid Waste Disposal Conditions, Plate
    V: Septic Tank Conditions, Plate VI: General Construction Conditions, and Plate
    VII: Sand and Gravel Reserves. Resource also includes text on Environmental planning
    for the Brattleboro-Windsor region, Vermont. For more information see links provided.
    nnThis report is the seventh of a series that have resulted from studies sponsored
    by the Vermont Geological Survey to supply the geologic information necessary for
    certain aspects of environmental planning. The purpose of these reports is to present
    this information in a condensed and modified form so that it can be used by environmental
    planners.The present report attempts to describe and explain the geologic conditions
    of the Brattleboro-Windsor region, and to outline and summarize these conditions
    on a series of large-scale maps. ",nt"license_title": null,nt"extras":
